import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 25%;
  text-align: center;
`;

export const Button = styled.button`
  border-radius: 11px;
  margin-top: 10px;
  background-color: #2072d7b3;
  max-width: 6000px;
  max-height: 50px;
  min-width: 300px;
  min-height: 50px;
  cursor: pointer;
  &:hover {
    box-shadow: 0 12px 16px 0 rgba(0, 0, 0, 0.24),
      0 17px 50px 0 rgba(0, 0, 0, 0.19);
  }
`;

export const ButtonText = styled.h1`
  color: #fffffff0;
  margin: auto;
  font-family: "Roboto", sans-serif;
  letter-spacing: 3px;
  font-size: 28px;
  text-shadow: -1px -1px 0 #000,
  1px -1px 0 #000,
  -1px 1px 0 #000,
  1px 1px 0 #000;
`;
